import Vue from 'vue'
import App from './App.vue'
import router from './router'
import store from './store'
import vuetify from './plugins/vuetify'
import VueI18n from "vue-i18n";

Vue.config.productionTip = false

export const i18n = new VueI18n({
  locale: 'en',
  fallbackLocale: 'en'
});

new Vue({
  router,
  store,
  vuetify,
  i18n,
  render: h => h(App)
}).$mount('#app')
